import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [ repository, setRepository] = useState<any>(['']);
  const [input, setInput] = useState<string>('')
  const logo: string = 'https://tibiawiki.com.br/images/5/52/Tibia_Logo.png'

  useEffect(() => {
    axios.get('https://api.tibiadata.com/v2/characters/Sarapora.json')
    .then((res)=> {
      setRepository(res)
    })
    .catch((err) => console.log(err)
    )
  },[])

  return (
      <div className="App">
        <header className="App-header">
          <img src={logo} alt="tibia" />
          <h1>Tibia Information</h1>
          <input type="text" value={input} onChange={(e) => setInput(e.target.value)}/>
          <table>
          </table>
        </header>
      </div>
  );
}

export default App;
